import React from "react";
import Headphones from "./Headphones";

import axios from "axios";

class Headphone extends React.Component {
  constructor() {
    super();
    this.state = {
      todos: []
    };
  }

  componentDidMount() {
    axios.get("/headphones/Apple-AirPods").then(response => {
      this.setState(() => {
        return {
          todos: response.data
        };
      });
    });
  }

  render() {
    let mappedTodos = this.state.todos.map(todo => {
      return (
        <Headphones
          title={todo.title}
          description={todo.description}
          price={todo.price}
        />
      );
    });

    return mappedTodos;
  }
}

export default TodoList;
